var handleDataTableSelect = function () {
        "use strict";
        0 !== $("#data-table-select").length && $("#data-table-select").DataTable({
            select: !0,
            responsive: !0
        })
    },
    TableManageTableSelect = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableSelect()
            }
        }
    }();
